import React from 'react'

function Movie(props) {
  return (
        <div key={props.movie.id}>
      <h1>{props.movie.name}</h1>
      <p>Rating: {props.movie.rating}</p>
      <p>Description: {props.movie.description}</p>
    </div>
  )
}

export default Movie
